import React from 'react';
import {
  AppBar, Button, IconButton, Toolbar, Typography, Stack, CssBaseline, createTheme,
} from '@mui/material';
import { ThemeProvider } from '@emotion/react';

export default function Navbar() {
  const theme = createTheme({
    palette: {
        type: 'light',
        primary: {
          main: '#ffffff',
        },
        secondary: {
          main: '#0096FF',
        },
        warning: {
          main: '#EA3C3C',
        },
        info: {
          main: '#0096FF',
        },
        button: {
          textTransform: 'none',
        },
      },
      typography: {
        fontFamily: 'DM Sans',
        button: {
          textTransform: 'none',
        },
      },
  });

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar
        className="appbar"
        position="static"
        sx={{
          bgcolor: 'background.paper',
          boxShadow: 0,
          borderRadius: 2,
          p: 2,
          minWidth: 300,
        }}
      >
        <Toolbar>
          <Typography variant="h4" component="div" sx={{ flexGrow: 1, color: '#0096FF' }}>
            Penn Buddy
          </Typography>
          <Stack direction="row" spacing={2}>
            <Button color="inherit" sx={{ color: 'black' }}>Activity Feed</Button>
            <Button color="inherit" sx={{ color: 'black' }}>Chat Room</Button>
            <Button color="inherit" sx={{ color: 'black' }}>My History</Button>
            <Button color="inherit" sx={{ color: '#0096FF' }}>Create Post</Button>
            <Button color="inherit" sx={{ color: 'white', backgroundColor: '#EA3C3C' }}>My Profile</Button>
          </Stack>
        </Toolbar>
      </AppBar>
    </ThemeProvider>

  );
}
